import React, { FC } from "react";
import { Global, css } from "@emotion/core";
import styled from "@emotion/styled";

const globalStyles = (
  <Global
    styles={css`
      html {
        background: white;
      }
    `}
  ></Global>
);

const Title = styled.h1`
  color: red;
`;

const Logo = styled.img`
  max-width: 50%;
  display: block;
  margin: auto;
`;

const Home: FC = () => (
  <div>
    {globalStyles}
    <Title>Hello world!</Title>
    <Logo src="/platzi-logo.png" alt="logo" />
  </div>
);

export default Home;
